(function($,Drupal,once){Drupal.behaviors.webformOffCanvasEvents={attach:function(){if(once('webform-off-canvas','html').length){$(window).on({'dialog:aftercreate':function(event,dialog,$element,settings){if(Drupal.offCanvas.isOffCanvas($element)){$(window).trigger('resize.tabs')}},'dialog:afterclose':function(event,dialog,$element,settings){if(Drupal.offCanvas.isOffCanvas($element)){$(window).trigger('resize.tabs')}}})}}};$(document.body).append('<style id="ckeditor-off-canvas-reset"></style>')})(jQuery,Drupal,once)